import React from 'react';

export default class Logo extends React.Component {
        render() {
    return (<svg width="88" height="88" viewBox="0 0 88 88">
        <image id="logo" width="88" height="88" xlink href="data:img/png;base64,"/>
      </svg>)
        }
};
